import {
  FlatList,
  StyleSheet,
  Text,
  TextInput,
  View,
  SafeAreaView,
} from "react-native";
import React, { useState, useEffect } from "react";
import SplashScreen from "./SplashScreen";
import SignUp from "./SignUp";
import * as Google from "expo-auth-session/providers/google";
import * as WebBrowser from "expo-web-browser";
import {
  GoogleAuthProvider,
  onAuthStateChanged,
  signInWithCredential,
} from "firebase/auth";
import { auth } from "../config/firebaseConfig";
import AsyncStorage from "@react-native-async-storage/async-storage";

WebBrowser.maybeCompleteAuthSession();

export default function App() {
  const [userInfo, setUserInfo] = useState();
  const [resquest, response, promptAsync] = Google.useAuthRequest({
    iosClientId:
      "785238745463-2j6vge0h1dn87alkjqqfranlh59ffgta.apps.googleusercontent.com",
    androidClientId:
      "785238745463-2qa5h1ssctdh0hojurv8siodpso5kgvm.apps.googleusercontent.com",
    webClientId:
      "642430350313-fbd6la090g01hl0jc8ri0jbjh8ab0d3l.apps.googleusercontent.com",
  });

  useEffect(() => {
    console.log("Got Here");
    if (response?.type == "success") {
      console.log(response);
      const id_token = response.params.access_token;
      const credential = GoogleAuthProvider.credential(id_token);
      signInWithCredential(auth, credential);
      console.log("Signed in with Google");
    }
  }, [response]);

  return <SignUp promptAsync={promptAsync} />;

  //return SplashScreen();
}

const styles = StyleSheet.create({
  container: {
    flexDirection: "column",
    flex: 1,
    backgroundColor: "lightblue",
    alignItems: "center",
    justifyContent: "center",
  },
  textInput: {
    height: 40,
    borderColor: "gray",
    borderWidth: 1,
    paddingHorizontal: 10,
    width: 200,
  },
});
